        <img src={image18} alt="img" />
        <div className="section-details">
          Lorem ipsum dolor sit amet consectetur adipisicing elit. Molestiae
          iste dolore sit quod et, eveniet est tempore repudiandae quia
          excepturi.
        </div>
      </div>
    </div>
  );
};

export default Section;
